import bisect

def process_queries_and_count(N, Q, L, R, A, queries):

    def f(z):
        for (q, x, s, t) in queries:
            if q == 1:
                if z >= x:
                    z = t * (z + s)
            elif z <= x:
                if z - s < 0:
                    z = -(abs(z - s) // t)
                else:
                    z = (z - s) // t
        return z
    A.sort()
    ng = pow(2, 63)
    ok = +ng
    for _ in range(100):
        mid = (ok + ng) // 2
        if f(mid) <= R:
            ok = mid
        else:
            ng = mid
    right = ok
    ok = pow(2, 63)
    ng = -ok
    for _ in range(100):
        mid = (ok + ng) // 2
        if f(mid) >= L:
            ok = mid
        else:
            ng = mid
    left = ok
    k1 = bisect.bisect_left(A, left)
    k2 = bisect.bisect_right(A, right)
    return k2 - k1

